import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import reportWebVitals from './reportWebVitals';
import 'tachyons';
import Card from './Card';
import CardList from './CardList'
import {robots} from "./robots";

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
      <div>
          <Card name={robots[0].name} email={robots[0].email} id={robots[0].id} username={robots[0].username}/>
          <Card name={robots[1].name} email={robots[1].email} id={robots[1].id} username={robots[1].username}/>
          <Card name={robots[2].name} email={robots[2].email} id={robots[2].id} username={robots[2].username}/>
          <Card name={robots[3].name} email={robots[3].email} id={robots[3].id} username={robots[3].username}/>
          <Card name={robots[4].name} email={robots[4].email} id={robots[4].id} username={robots[4].username}/>
      </div>

  </React.StrictMode>
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
